import React from "react";
import WeatherIcon from "./WeatherIcon";

export default function WeatherForecastDay(propos) {
  return (
    <div className="WeatherForecastDay">
      <div className="WeatherForecast-day">{propos.data.time}</div>
      <WeatherIcon code={propos.data.condition.icon_url} size={36} />
      <div className="WeatherForecast-temperatures">
        <span className="WeatherForecast-temperature-max">
          {propos.data.temperature.maximum}°
        </span>
        <span className="WeatherForecast-temperature-min">
          {propos.data.temperature.minimum}°
        </span>
      </div>
    </div>
  );
}
